import React from "react";
import TradingViewChart from "react-tradingview-widget";

function App() {
  return (
    <div className="App">
      <h1>Bitcoin Chart</h1>
      <TradingViewWidget symbol="BTCUSD" theme="light" locale="en" autosize />
    </div>
  );
}

export default App;
